import React, { Component } from 'react';
import { View, Text } from 'react-native';
import { Input, Icon } from 'react-native-elements';

export default class AddNewClub extends Component {
  render() {
    return(<View>
       <Input
        placeholder='BASIC INPUT'
      />
    </View>);
  }
}
